description:
Nederlands

Nikki's dochter Sarah is negentien en moet naar de universiteit. Ze heeft echter haar eigen spirituele twijfels. Haar moeder beweert dat ze tien jaar geleden voor een maaltijd samen zat met de Almachtige Vader. Meer en meer begint ze te denken dat haar moeder krankzinnig wordt, zeker als ze een mysterieuze reisgezel ontmoet die haar minachting voor de godsdienst deelt.

Engels

Ten years have passed. Nikki's daughter Sarah, now 19 and heading West for college, is at her own spiritual crossroads. To make matters worse, her mother has recently revealed that, nearly a decade ago, she was the dinner guest of the Almighty himself. Thinking her mom is certifiably insane, Sarah strikes up an unlikely friendship with a travel companion who shares her disdain for religion. 
